import React from 'react';

//videos로 검색결과를 받아서 보내줌
const VideoList = ({ videos }) => {
  console.log('videoList :');
  console.log(videos);

  const renderedVideos = () => {
    return { videos };
  };

  return (
    <div className='container'>
      <div className='row'>
        <div className='col'>{renderedVideos}</div>
      </div>
    </div>
  );
};

export default VideoList;
